  //render some html codes, every react component must render some code to the webpage
  render(){
    return (
    <div className="App">
      <h1>This is react app</h1>
      <Person name  = "Mike" age = "25"/>
      <Person name = "Maria" age = "24"/>
      <Person name = "John" age = "26"/>
    </div>

  );
  }
}

export default App;
